import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  BrowserRouter
} from "react-router-dom";
import Home from './scenes/Home';
import Toolbar from './components/Toolbar';
import SignUp from './scenes/SignUp';
import 'bulma/css/bulma.css'
import './App.css';

function App() {
  const isLogin = false;
  return (
    <BrowserRouter>
      <Toolbar isLogin={isLogin} />
      <Router>
        <Switch>
          <Route exact path="/"> <Home /> </Route>
          <Route path="/masuk"> <About /> </Route>
          <Route path="/daftar"> <SignUp /> </Route>
          <Route path="/home"> <Home /> </Route>
        </Switch>
      </Router>
    </BrowserRouter>
  );
}

function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
    </div>
  );
}

export default App;
